import React, { useState } from "react";
import { Formik, Form, Field, ErrorMessage } from "formik";
import * as Yup from "yup";
import "./ManageBooks.css";

interface BookFormValues {
  isbn: string;
  title: string;
  author: string;
  publisher: string;
  yearPublished: number;
  availableCopies: number;
  genre: string;
  summary: string;
  coverImageUrl: string;
}

const ManageBooks: React.FC = () => {
  const [books, setBooks] = useState<BookFormValues[]>([]);

  const addBook = (values: BookFormValues) => {
    setBooks([...books, values]);
  };

  const deleteBook = (isbn: string) => {
    setBooks(books.filter((book) => book.isbn !== isbn));
  };

  return (
    <div className="manage-books">
      <h2>Add Book</h2>
      <Formik
        initialValues={{
          isbn: "",
          title: "",
          author: "",
          publisher: "",
          yearPublished: 0,
          availableCopies: 0,
          genre: "",
          summary: "",
          coverImageUrl: "",
        }}
        validationSchema={Yup.object({
          isbn: Yup.string().required("Required"),
          title: Yup.string().required("Required"),
          author: Yup.string().required("Required"),
          publisher: Yup.string().required("Required"),
          yearPublished: Yup.number().required("Required"),
          availableCopies: Yup.number().required("Required"),
          genre: Yup.string().required("Required"),
          summary: Yup.string().required("Required"),
          coverImageUrl: Yup.string().url("Invalid URL").required("Required"),
        })}
        onSubmit={(values, { resetForm }) => {
          addBook(values);
          resetForm();
        }}
      >
        <Form>
          <Field name="isbn" type="text" placeholder="ISBN" />
          <ErrorMessage name="isbn" component="div" />
          <Field name="title" type="text" placeholder="Title" />
          <ErrorMessage name="title" component="div" />
          <Field name="author" type="text" placeholder="Author" />
          <ErrorMessage name="author" component="div" />
          <Field name="publisher" type="text" placeholder="Publisher" />
          <ErrorMessage name="publisher" component="div" />
          <Field
            name="yearPublished"
            type="number"
            placeholder="Year Published"
          />
          <ErrorMessage name="yearPublished" component="div" />
          <Field
            name="availableCopies"
            type="number"
            placeholder="Available Copies"
          />
          <ErrorMessage name="availableCopies" component="div" />
          <Field name="genre" type="text" placeholder="Genre" />
          <ErrorMessage name="genre" component="div" />
          <Field name="summary" type="text" placeholder="Summary" />
          <ErrorMessage name="summary" component="div" />
          <Field
            name="coverImageUrl"
            type="text"
            placeholder="Cover Image URL"
          />
          <ErrorMessage name="coverImageUrl" component="div" />
          <button type="submit">Add Book</button>
        </Form>
      </Formik>

      <h2>Delete Book</h2>
      <ul>
        {books.map((book) => (
          <li key={book.isbn}>
            {book.title} by {book.author}
            <button onClick={() => deleteBook(book.isbn)}>Delete</button>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default ManageBooks;
